    incorrect Form 24 upload occurred through FECFiler, loading a prior cycle report.
    \ The correct Form 24 was later uploaded when that error was discovered during
    preparation of the Pre-General report. The error was not discovered until this
    time because the FECFiler software does not make a distinction between a closed
    report and filed report. Instead, when a report is closed FECFiler changes the
    line to the same color and makes no further changes in visual indications to distinguish
    between a filed report and one that is only closed but not filed. Please consider
    this change request to the FECFiler application.\n"
